import axios from "axios"
import React, { useEffect, useState } from 'react'
import { Box } from '@mui/system';
import { TextField } from "@mui/material";
import Button from '@mui/material/Button';
import { Typography } from '@mui/material';


const Records = () => {
    const [student, setStudent] = useState({
        id: "", firstname: "", lastname: "", phonenumber: "", zip: "", statecode: "", statename: ""
    })

    const [search, setSearch] = useState();

    const [data, setData] = useState(null);
    const state = { button: 1 };

    const onChangeId = (e) => {
        setStudent({ ...student, [e.target.name]: e.target.value })
    }
    const onChangeSearch = (e) => {
        setSearch({ ...search, [e.target.name]: e.target.value });
    }
    const onChangeFirstName = (e) => {
        setStudent({ ...student, [e.target.name]: e.target.value })
    }
    const onChangeLastName = (e) => {
        setStudent({ ...student, [e.target.name]: e.target.value })
    }
    const onChangePhoneNumber = (e) => {
        setStudent({ ...student, [e.target.name]: e.target.value })
    }
    const onChangeZip = (e) => {
        setStudent({ ...student, [e.target.name]: e.target.value })
    }
    const onChangeStateCode = (e) => {
        setStudent({ ...student, [e.target.name]: e.target.value })
    }
    const onChangeStateName = (e) => {
        setStudent({ ...student, [e.target.name]: e.target.value })
    }

    async function StudentData(e) {
        e.preventDefault();
        if (state.button === 1) {
            axios
                .post("http://localhost:3300/students/", student)
                .then(() => alert(`A student named ${student.firstname} ${student.lastname} has been added to the database.`))
                .catch((err) => {
                    console.log(err);
                    alert("Error detected");
                });

            setStudent({ id: "", firstname: "", lastname: "", phonenumber: "", zip: "", statecode: "", statename: "" })
        }
    }
    useEffect(() => {
        axios
            .get("http://localhost:3300/students")
            .then((response) => {
                console.log("response::", response.data)
                setData(response.data)
            })
            .catch((err) => {
                alert(`error occurred within application.`)
            })
    }, []);

    return (
        <Box position="static" width="300">
            <form onSubmit={StudentData}>
                <div>
                    <label>Id:
                    <TextField
                        type="number" name="id" value={student.id} variant='filled' onChange={onChangeId}></TextField>
                    {/* &nbsp; */}
                    </label>
                    <label>firstname:</label>
                    <TextField
                        type="text" name="firstname" value={student.firstname} variant='filled' onChange={onChangeFirstName}></TextField>
                    {/* <br />
                    <br />
 */}
                    <label>lastname:</label>
                    <TextField
                        type="text" name="lastname" value={student.lastname} variant='filled' onChange={onChangeLastName}></TextField>
                    &nbsp;
                    <label>phonenumber:</label>
                    <TextField
                        type="text" name="phonenumber" value={student.phonenumber} variant='filled' onChange={onChangePhoneNumber}></TextField>
                    <br />
                    <br />
                    <label>zip:</label>
                    <TextField
                        type="text" name="zip" value={student.zip} variant='filled' onChange={onChangeZip}></TextField>
                    <label>statecode:</label>
                    &nbsp;
                    <TextField
                        type="number" name="statecode" value={student.statecode} variant='filled' onChange={onChangeStateCode}></TextField>
                    <br />
                    <br />
                    <label>statename:</label>
                    <TextField
                        type="text" name="statename" value={student.statename} variant='filled' onChange={onChangeStateName}></TextField>
                    &nbsp;
                    <Button variant="contained" color="success" size="large" type="submit" onClick={() => { state.button = 1 }}>Submit</Button>
                </div>
            </form>
        </Box>
    );
};

export default Records
